import Home from './pages/home';
import Team from './pages/team';
import { Header, Footer, Nav, Overlay } from './components/'
import Project from './pages/project';
import Course from './pages/course';

function App() {
  return (
    <div className="App">
      <Header />
      <Nav />
      <Overlay />
      <Course />
      <Footer />


    </div>
  );
}

export default App;
